# Function to create the KubeTidy UI using WPF
function Start-KubeTidyLauncher {

    param (
        [Parameter(Mandatory = $true)]
        [System.Windows.Window]$LoadingWindow
    )

Add-Type -AssemblyName PresentationFramework
Add-Type -AssemblyName PresentationCore
Add-Type -AssemblyName WindowsBase
Add-Type -AssemblyName System.Xaml

# # Ensure the KubeTidy module is installed and loaded
# if (-not (Get-Module -ListAvailable -Name 'KubeTidy')) {
#     try {
#         Install-Module -Name 'KubeTidy' -Scope CurrentUser -Force -ErrorAction Stop
#     }
#     catch {
#         Write-Error "Error: Unable to install the KubeTidy module from the PowerShell Gallery. Please check your internet connection and permissions."
#         return
#     }
# }

# # Load the KubeTidy module
# try {
#     Import-Module KubeTidy -ErrorAction Stop
# }
# catch {
#     Write-Error "Error: Unable to load the KubeTidy module. Please make sure it is installed and accessible."
#     return
# }

# Function to get system theme (light or dark mode)
function Get-SystemTheme {
    try {
        $key = "HKCU:\Software\Microsoft\Windows\CurrentVersion\Themes\Personalize"
        $appsUseLightTheme = Get-ItemPropertyValue -Path $key -Name "AppsUseLightTheme"
        if ($appsUseLightTheme -eq 0) {
            return "Dark"
        }
        return "Light"
    }
    catch {
        # Default to Light theme if anything goes wrong
        return "Light"
    }
}

# Determine color scheme based on dark mode setting
$isDarkMode = Get-SystemTheme

# Set colors based on mode
$formBackColor = if ($isDarkMode -eq "Dark") { "#202f3d" } else { "#f0f0f0" }
$headerBackColor = "Black"
$headerForeColor = "White"
$labelForeColor = if ($isDarkMode -eq "Dark") { "White" } else { "Black" }
$btnBackColor = "#11A9BB"
$txtBackColor = if ($isDarkMode -eq "Dark") { "#323232" } else { "White" }
$txtForeColor = if ($isDarkMode -eq "Dark") { "White" } else { "Black" }

# Base64-encoded KubeTidy logo (replace the placeholder with the actual Base64 string from KubeTidyLogo.base64.txt)
$base64KubeTidyLogo = @"

"@



    [xml]$xaml = @"
<Window xmlns="http://schemas.microsoft.com/winfx/2006/xaml/presentation" 
        xmlns:x="http://schemas.microsoft.com/winfx/2006/xaml"
        Title="KubeTidy" 
        SizeToContent="WidthAndHeight"
        MinHeight="450" MinWidth="920"
        Background="$formBackColor" 
        WindowStartupLocation="CenterScreen" 
        ResizeMode="CanResizeWithGrip" 
        FontFamily="Roboto" 
        FontSize="14">

    <DockPanel LastChildFill="True">
        <!-- Updated Header Section -->
        <Grid DockPanel.Dock="Top" Background="$headerBackColor" Height="60">
            <Grid.ColumnDefinitions>
                <ColumnDefinition Width="Auto" />  <!-- Logo Column -->
                <ColumnDefinition Width="*" />     <!-- Spacer Column -->
                <ColumnDefinition Width="Auto" />  <!-- Checkboxes Column -->
                <ColumnDefinition Width="Auto" />  <!-- Run Button Column -->
            </Grid.ColumnDefinitions>

            <!-- Align the KubeTidy Logo Image on the left -->
            <Image Grid.Column="0" x:Name="imgKubeTidyLogo" Height="40" VerticalAlignment="Center" HorizontalAlignment="Left" Margin="10,0,10,0" />

            <!-- Center-aligned Checkboxes for Options -->
            <StackPanel Grid.Column="2" Orientation="Horizontal" VerticalAlignment="Center" HorizontalAlignment="Center" Margin="10,0">
                <CheckBox x:Name="chkBackup" Content="Backup Config" Foreground="$headerForeColor" Margin="10,0" IsChecked="True"/>
                <CheckBox x:Name="chkDryRun" Content="Dry Run" Foreground="$headerForeColor" Margin="10,0"/>
                <CheckBox x:Name="chkForce" Content="Force" Foreground="$headerForeColor" Margin="10,0"/>
            </StackPanel>

            <!-- Align Run Button to the right -->
            <Button x:Name="btnRun" Grid.Column="3" Content="Run" Width="150" Height="30" HorizontalAlignment="Right" Margin="10"
                    Background="$btnBackColor" Foreground="$headerForeColor" FontWeight="Bold"/>
        </Grid>

        <!-- Main Content -->
        <ScrollViewer DockPanel.Dock="Top" VerticalScrollBarVisibility="Auto">
            <StackPanel Margin="10" VerticalAlignment="Top">

                <!-- KubeConfig Path Section -->
                <Grid Margin="10,20,10,20">
                    <Grid.ColumnDefinitions>
                        <ColumnDefinition Width="150" />  <!-- Label Column -->
                        <ColumnDefinition Width="*" />    <!-- Input Box Column -->
                        <ColumnDefinition Width="Auto" /> <!-- Browse Button Column -->
                    </Grid.ColumnDefinitions>

                    <TextBlock Text="KubeConfig Path:" VerticalAlignment="Center" Foreground="$labelForeColor" Grid.Column="0" Margin="10,0,10,0"/>
                    <TextBox x:Name="txtKubeConfig" Height="30" Background="$txtBackColor" Foreground="$txtForeColor" Margin="10,0,10,0" Grid.Column="1" VerticalContentAlignment="Center"/>
                    <Button x:Name="btnBrowseKubeConfig" Content="Browse" Width="100" Height="30" Background="$btnBackColor" Foreground="$headerForeColor" Grid.Column="2" Margin="10,0,10,0"/>
                </Grid>

                <!-- Radio Buttons Section for List Clusters and Contexts -->
                <StackPanel Orientation="Horizontal" HorizontalAlignment="Left" Margin="10,15">
                    <RadioButton x:Name="radListClusters" Content="List Clusters" GroupName="RadioGroup" Foreground="$labelForeColor" Margin="10,0"/>
                    <RadioButton x:Name="radListContexts" Content="List Contexts" GroupName="RadioGroup" Foreground="$labelForeColor" Margin="10,0"/>
                    <RadioButton x:Name="radNone" Content="None" GroupName="RadioGroup" Foreground="$labelForeColor" IsChecked="True" Margin="10,0"/>
                </StackPanel>

                <!-- Checkboxes Section for Exclude Cluster, Merge Config, Destination Config, Export Contexts -->
                <StackPanel Orientation="Horizontal" HorizontalAlignment="Left" Margin="10,15">
                    <CheckBox x:Name="chkExcludeCluster" Content="Exclude Cluster" Foreground="$labelForeColor" Margin="10,0"/>
                    <CheckBox x:Name="chkExportContexts" Content="Export Contexts" Foreground="$labelForeColor" Margin="10,0"/>
                    <CheckBox x:Name="chkMergeConfig" Content="Merge Config Files" Foreground="$labelForeColor" Margin="10,0"/>
                    <CheckBox x:Name="chkDestinationConfig" Content="Destination Config" Foreground="$labelForeColor" Margin="10,0"/>
                </StackPanel>

                <!-- Exclusion List Section, Merge Config, Export Contexts, Destination Config -->
                <Grid Margin="10,20,10,20">
                    <Grid.RowDefinitions>
                        <RowDefinition Height="Auto"/>
                        <RowDefinition Height="Auto"/>
                        <RowDefinition Height="Auto"/>
                        <RowDefinition Height="Auto"/>
                    </Grid.RowDefinitions>
                    <Grid.ColumnDefinitions>
                        <ColumnDefinition Width="150" />  <!-- Label Column -->
                        <ColumnDefinition Width="*" />    <!-- Input Box Column -->
                        <ColumnDefinition Width="Auto" /> <!-- Browse Button Column, if applicable -->
                    </Grid.ColumnDefinitions>

                    <TextBlock x:Name="lblExclusion" Text="Exclusion List:" VerticalAlignment="Center" Foreground="$labelForeColor" Visibility="Collapsed" Grid.Row="0" Grid.Column="0" Margin="10,0"/>
                    <TextBox x:Name="txtExclusion" Height="30" Background="$txtBackColor" Foreground="$txtForeColor" Margin="10,10,10,10" Visibility="Collapsed" Grid.Row="0" Grid.Column="1" VerticalContentAlignment="Center"/>
                    
                    <TextBlock x:Name="lblExportContexts" Text="Export Contexts:" VerticalAlignment="Center" Foreground="$labelForeColor" Visibility="Collapsed" Grid.Row="1" Grid.Column="0" Margin="10,0"/>
                    <TextBox x:Name="txtExportContexts" Height="30" Background="$txtBackColor" Foreground="$txtForeColor" Margin="10,10,10,10" Visibility="Collapsed" Grid.Row="1" Grid.Column="1" VerticalContentAlignment="Center"/>

                    <TextBlock x:Name="lblMergeConfig" Text="Merge Config Files:" VerticalAlignment="Center" Foreground="$labelForeColor" Visibility="Collapsed" Grid.Row="2" Grid.Column="0" Margin="10,0"/>
                    <TextBox x:Name="txtMergeConfig" Height="30" Background="$txtBackColor" Foreground="$txtForeColor" Margin="10,10,10,10" Visibility="Collapsed" Grid.Row="2" Grid.Column="1" VerticalContentAlignment="Center"/>
                    <Button x:Name="btnBrowseMergeConfig" Content="Browse" Width="100" Height="30" Background="$btnBackColor" Foreground="$headerForeColor" Visibility="Collapsed" Grid.Row="2" Grid.Column="2" Margin="10,0"/>

                    <TextBlock x:Name="lblDestinationConfig" Text="Destination Config:" VerticalAlignment="Center" Foreground="$labelForeColor" Visibility="Collapsed" Grid.Row="3" Grid.Column="0" Margin="10,0"/>
                    <TextBox x:Name="txtDestinationConfig" Height="30" Background="$txtBackColor" Foreground="$txtForeColor" Margin="10,10,10,10" Visibility="Collapsed" Grid.Row="3" Grid.Column="1" VerticalContentAlignment="Center"/>
                    <Button x:Name="btnBrowseDestinationConfig" Content="Browse" Width="100" Height="30" Background="$btnBackColor" Foreground="$headerForeColor" Visibility="Collapsed" Grid.Row="3" Grid.Column="2" Margin="10,0"/>
                </Grid>
            </StackPanel>
        </ScrollViewer>
                        <!-- Output Section -->
                <TextBox x:Name="txtOutput" MinHeight="150" Margin="10" VerticalScrollBarVisibility="Auto" IsReadOnly="True" TextWrapping="Wrap" FontFamily="Roboto" Background="Black" Foreground="Cyan" HorizontalAlignment="Stretch" VerticalAlignment="Stretch" DockPanel.Dock="Bottom"/>
    </DockPanel>
</Window>
"@

    # Load XAML
    $reader = (New-Object System.Xml.XmlNodeReader $xaml)
    $window = [Windows.Markup.XamlReader]::Load($reader)

    if (-not $window) {
        Write-Error "Failed to load the WPF window."
        return
    }

    # Set KubeTidy Logo Image
    $imgKubeTidyLogo = $window.FindName("imgKubeTidyLogo")
    if ($imgKubeTidyLogo -ne $null) {
        $bytesKubeTidyLogo = [Convert]::FromBase64String($base64KubeTidyLogo)
        $streamKubeTidyLogo = New-Object System.IO.MemoryStream(, $bytesKubeTidyLogo)
        $bitmapKubeTidyLogo = New-Object Windows.Media.Imaging.BitmapImage
        $bitmapKubeTidyLogo.BeginInit()
        $bitmapKubeTidyLogo.StreamSource = $streamKubeTidyLogo
        $bitmapKubeTidyLogo.CacheOption = [Windows.Media.Imaging.BitmapCacheOption]::OnLoad
        $bitmapKubeTidyLogo.EndInit()
        $bitmapKubeTidyLogo.Freeze()
        $imgKubeTidyLogo.Source = $bitmapKubeTidyLogo
    }

# Define Progress Window in XAML format, with dynamic background and foreground colors
$progressWindowXAML = @"
<Window xmlns="http://schemas.microsoft.com/winfx/2006/xaml/presentation"
        xmlns:x="http://schemas.microsoft.com/winfx/2006/xaml"
        Title="Processing..." Height="150" Width="300" WindowStartupLocation="CenterScreen" Background='$formBackColor'>
    <StackPanel HorizontalAlignment="Center" VerticalAlignment="Center">
        <TextBlock Name="txtProgressStatus" Text="Processing..." HorizontalAlignment="Center" Margin="10" FontSize="20" Foreground='$txtForeColor'/>
    </StackPanel>
</Window>
"@

# Function to create a new progress window (so it can be reopened after closing)
function New-ProgressWindow {
    # Use -replace to inject the background and foreground colors from the variables into the XAML string
    $windowXaml = $progressWindowXAML -replace '\$formBackColor', $formBackColor
    $windowXaml = $windowXaml -replace '\$txtForeColor', $txtForeColor
    
    # Load the XAML as an XML document and create the WPF window
    [xml]$xaml = $windowXaml
    $reader = (New-Object System.Xml.XmlNodeReader $xaml)
    $progressWindow = [Windows.Markup.XamlReader]::Load($reader)

    # Access elements from the progress window
    $txtProgressStatus = $progressWindow.FindName("txtProgressStatus")
    
    return $progressWindow
}

# Set Button Event Handlers
$btnRun = $window.FindName("btnRun")
$txtOutput = $window.FindName("txtOutput")

if ($btnRun) {
    $btnRun.Add_Click({
        $txtOutput.Clear()
        $txtOutput.AppendText("Working...`n")
        $window.Cursor = [System.Windows.Input.Cursors]::Wait

        # Create a new progress window every time the button is clicked
        $progressWindow = New-ProgressWindow

        # Show the progress window (non-modal, so the rest of the code continues to execute)
        $progressWindow.Show()

        try {
            # Gather inputs from UI elements
            $kubeConfigPath = ($window.FindName("txtKubeConfig")).Text
            $backup = ($window.FindName("chkBackup")).IsChecked
            $dryRun = ($window.FindName("chkDryRun")).IsChecked
            $force = ($window.FindName("chkForce")).IsChecked
            $listClusters = ($window.FindName("radListClusters")).IsChecked
            $listContexts = ($window.FindName("radListContexts")).IsChecked
            $excludeCluster = ($window.FindName("chkExcludeCluster")).IsChecked
            $exclusionList = if ($excludeCluster) { ($window.FindName("txtExclusion")).Text } else { $null }
            $mergeConfig = ($window.FindName("chkMergeConfig")).IsChecked
            $mergeConfigs = if ($mergeConfig) { ($window.FindName("txtMergeConfig")).Text -split ";" } else { $null }
            $exportContexts = ($window.FindName("chkExportContexts")).IsChecked
            $exportContextsPath = if ($exportContexts) { ($window.FindName("txtExportContexts")).Text } else { $null }
            $destinationConfigChecked = ($window.FindName("chkDestinationConfig")).IsChecked
            $destinationConfig = if ($destinationConfigChecked) { ($window.FindName("txtDestinationConfig")).Text } else { $null }

            # Run your task
            $output = & {
                $arguments = @{
                    KubeConfigPath    = $kubeConfigPath
                    Backup            = $backup
                    Force             = $force
                    ListClusters      = $listClusters
                    ListContexts      = $listContexts
                    DryRun            = $dryRun
                    ExclusionList     = if ($excludeCluster) { $exclusionList } else { $null }
                    MergeConfigs      = $mergeConfigs
                    DestinationConfig = if ($destinationConfigChecked) { $destinationConfig } else { $null }
                    ExportContexts    = if ($exportContexts) { $exportContextsPath } else { $null }
                }
                # Run Invoke-KubeTidy with arguments
                Invoke-KubeTidy @arguments
            } *>&1 | Out-String
    
            # Clear "Working..." message and display actual output
            $txtOutput.Clear()
            $txtOutput.AppendText($output)
    
        } catch {
            $txtOutput.Clear()
            $txtOutput.AppendText("Error: $_`n")
        } finally {
            # Reset cursor to default
            $window.Cursor = [System.Windows.Input.Cursors]::Arrow
            # Close the progress window once the task is done
            $progressWindow.Close()
        }
    })
}

    # Button Browse event for KubeConfig
    $btnBrowseKubeConfig = $window.FindName("btnBrowseKubeConfig")
    if ($btnBrowseKubeConfig) {
        $btnBrowseKubeConfig.Add_Click({
            $fileDialog = New-Object -TypeName Microsoft.Win32.OpenFileDialog
            $fileDialog.Filter = "KubeConfig Files (*.yaml, *.yml, *.config)|*.yaml;*.yml;*.config|All Files (*.*)|*.*"
            if ($fileDialog.ShowDialog() -eq $true) {
                $txtKubeConfig = $window.FindName("txtKubeConfig")
                $txtKubeConfig.Text = $fileDialog.FileName
            }
        })
    }

    # Browse Merge Config event
    $btnBrowseMergeConfig = $window.FindName("btnBrowseMergeConfig")
    if ($btnBrowseMergeConfig) {
        $btnBrowseMergeConfig.Add_Click({
            $fileDialog = New-Object -TypeName Microsoft.Win32.OpenFileDialog
            $fileDialog.Filter = "Config Files (*.yaml, *.yml, *.config)|*.yaml;*.yml;*.config|All Files (*.*)|*.*"
            $fileDialog.Multiselect = $true
            if ($fileDialog.ShowDialog() -eq $true) {
                $txtMergeConfig = $window.FindName("txtMergeConfig")
                $txtMergeConfig.Text = ($fileDialog.FileNames -join ";")
            }
        })
    }

    # Destination Config event
    $btnBrowseDestinationConfig = $window.FindName("btnBrowseDestinationConfig")
    if ($btnBrowseDestinationConfig) {
        $btnBrowseDestinationConfig.Add_Click({
            $fileDialog = New-Object -TypeName Microsoft.Win32.SaveFileDialog
            $fileDialog.Filter = "Config Files (*.yaml, *.yml, *.config)|*.yaml;*.yml;*.config|All Files (*.*)|*.*"
            if ($fileDialog.ShowDialog() -eq $true) {
                $txtDestinationConfig = $window.FindName("txtDestinationConfig")
                $txtDestinationConfig.Text = $fileDialog.FileName
            }
        })
    }

    # CheckBox Visibility Handling for Exclude Cluster, Merge Config, Export Contexts, and Destination Config
    $chkExcludeCluster = $window.FindName("chkExcludeCluster")
    $txtExclusion = $window.FindName("txtExclusion")
    $lblExclusion = $window.FindName("lblExclusion")
    if ($chkExcludeCluster) {
        $chkExcludeCluster.Add_Checked({
            $txtExclusion.Visibility = [System.Windows.Visibility]::Visible
            $lblExclusion.Visibility = [System.Windows.Visibility]::Visible
        })
        $chkExcludeCluster.Add_Unchecked({
            $txtExclusion.Visibility = [System.Windows.Visibility]::Collapsed
            $lblExclusion.Visibility = [System.Windows.Visibility]::Collapsed
        })
    }

    # Merge Config event visibility handling
    $chkMergeConfig = $window.FindName("chkMergeConfig")
    $txtMergeConfig = $window.FindName("txtMergeConfig")
    $lblMergeConfig = $window.FindName("lblMergeConfig")
    $btnBrowseMergeConfig = $window.FindName("btnBrowseMergeConfig")

    if ($chkMergeConfig) {
        $chkMergeConfig.Add_Checked({
            $txtMergeConfig.Visibility = [System.Windows.Visibility]::Visible
            $lblMergeConfig.Visibility = [System.Windows.Visibility]::Visible
            $btnBrowseMergeConfig.Visibility = [System.Windows.Visibility]::Visible  # Ensure button visibility
        })
        $chkMergeConfig.Add_Unchecked({
            $txtMergeConfig.Visibility = [System.Windows.Visibility]::Collapsed
            $lblMergeConfig.Visibility = [System.Windows.Visibility]::Collapsed
            $btnBrowseMergeConfig.Visibility = [System.Windows.Visibility]::Collapsed  # Hide button when unchecked
        })
    }

    $chkExportContexts = $window.FindName("chkExportContexts")
    $txtExportContexts = $window.FindName("txtExportContexts")
    $lblExportContexts = $window.FindName("lblExportContexts")
    if ($chkExportContexts) {
        $chkExportContexts.Add_Checked({
            $txtExportContexts.Visibility = [System.Windows.Visibility]::Visible
            $lblExportContexts.Visibility = [System.Windows.Visibility]::Visible
        })
        $chkExportContexts.Add_Unchecked({
            $txtExportContexts.Visibility = [System.Windows.Visibility]::Collapsed
            $lblExportContexts.Visibility = [System.Windows.Visibility]::Collapsed
        })
    }

    # Destination Config event visibility handling
    $chkDestinationConfig = $window.FindName("chkDestinationConfig")
    $txtDestinationConfig = $window.FindName("txtDestinationConfig")
    $lblDestinationConfig = $window.FindName("lblDestinationConfig")
    $btnBrowseDestinationConfig = $window.FindName("btnBrowseDestinationConfig")

    if ($chkDestinationConfig) {
        $chkDestinationConfig.Add_Checked({
            $txtDestinationConfig.Visibility = [System.Windows.Visibility]::Visible
            $lblDestinationConfig.Visibility = [System.Windows.Visibility]::Visible
            $btnBrowseDestinationConfig.Visibility = [System.Windows.Visibility]::Visible  # Ensure button visibility
        })
        $chkDestinationConfig.Add_Unchecked({
            $txtDestinationConfig.Visibility = [System.Windows.Visibility]::Collapsed
            $lblDestinationConfig.Visibility = [System.Windows.Visibility]::Collapsed
            $btnBrowseDestinationConfig.Visibility = [System.Windows.Visibility]::Collapsed  # Hide button when unchecked
        })
    }


    # Queue up another action to run asynchronously after the window is shown
$window.Dispatcher.InvokeAsync({
    # Code for the other action you want to run concurrently
    if ($LoadingWindow -and $LoadingWindow.IsVisible) {
        $LoadingWindow.Dispatcher.Invoke([action] { $LoadingWindow.Close() })
    }
})

    # Show the main window
    $null = $window.ShowDialog()

    Start-KubeDeckLauncher
}

#Start-KubeTidyLauncher